script: |
  super -f text -I q5114.spq | sort > q5114.out

inputs:
  - name: q5114.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT col2 NOT BETWEEN 88 * + + 41 + + col1 AND + CAST ( + - 57 AS INTEGER ) * + col1 + - + CAST ( - + col0 AS REAL ) + - + 44 + + col2 * - col2 + - col0;
  - name: tab1

outputs:
  - name: q5114.out
    data: |
